         Sebelumnya, RSUP Prof Dr RD Kandou menerima pasien rujukan dari Dinas Kesehatan Bitung dengan status pengawasan virus Corona (COVID-19). Pasien berusia 46 tahun itu mengeluh batuk dan menggigil.Baca juga: 1 Warga Sulsel yang Diisolasi di RS Wahidin Pernah ke Negara TerjangkitPasien tersebut merasakan keluhan sepuluh hari setelah dirinya sampai di Bitung. Pasien tersebut bekerja di Malaysia. Pesawat yang ditumpanginya sempat transit di Singapura sebelum berlanjut ke Manado.
